import React from 'react';
import emptyCart from './assets/img/cart3.svg';
const Cart = (svg) => {
    return (
        <img src={svg.img} alt="cart" className='w-7 h-7 flex inline-flex'/>
    )
}
const cartWidget = () => {
    return (
        <div>
            <Cart img={emptyCart}/>
        </div>
    )
}
export default cartWidget;
